import React from 'react'
import TradExpress from "../images/TradExpress.svg"



const Dashboard = () => {
    return (
        <div>
            <div  className='dashtrad'>
                 <img src={TradExpress} alt=""></img>  
             </div>
           
        </div>
    )
}

export default Dashboard
